import "./table.css"
import { useState } from 'react'
import React, { Component } from 'react'

export class Table extends Component {
    render() {
        return (
            <div className="quote-table">
                <table>
                    <th>
                        <td>Quote Date</td>
                        <td>Gallons</td>
                        <td>Delivery Date</td>
                        <td>PPG</td>

                    </th>
                </table>
            </div>
        )
    }
}

export default Table
